import styled from "styled-components"

function Home() {
    return (
        <div className="homepage">
            <Introduce></Introduce>
            <Solution></Solution>
            <Description></Description>
            <Techstack></Techstack>
        </div>
    );

}


function Introduce() {
     const do_it_style = styled.vid`
        background-color: darkgray;
        border-radius: 40px;
        color: #fff;
        font-size: 1rem;
        font-weight: bold;
        min-width: 80px;
        padding: 16px 32px;
        text-align: center;
        cursor: pointer;
        display: inline-block;
        position: relative;
        text-decoration: none;
        width: auto;
      `;
    return (
        <div className="home_introduce">
            <Script title="KNOT" scripts="KNOT Introduce script" style={do_it_style}></Script>
            <Image source=""></Image>
        </div>
    );
}

function Solution() {
    return (
        <div className="home_solution">
            <Image source=""></Image>
            <Script title="Solution" scripts="KNOT Solution script"></Script>
        </div>
    );
}

function Description() {
    return (
        <div className="home_description">
            <Script title="Description" scripts="KNOT Description script"></Script>
            <Image source=""></Image>
        </div>
    );
}

function Techstack() {
    return (
        <div className="home_techstack">

        </div>
    );
}


function Script(props) {
    return (
        <div className="home_script">
            <h1>{props.title}</h1>
            <p>{props.scripts}</p>
            <a style={props.style}>{props.value}</a>
        </div>

    );

}

function Image(props) {
    return (
        <div className="home_image">
            <img src={props.source}></img>
        </div>
    );
}

function Button(props) {
    return (
        <div className="home_button">
            <input type="button">{props.value}</input>
        </div>
    );
}

export default Home;
